CREATE TABLE TEMP_USER_INFO (
  USER_GUID varchar(36) PRIMARY KEY,
  USER_NAME varchar(255) default NULL,
  USER_PHONE varchar(100) default NULL,
  USER_EMAIL varchar(255) default NULL,
  USER_COMP varchar(255)   default NULL ,
  ESB_TX_ID VARCHAR(40) default NULL,
  ESB_STATE_CD CHAR(1)   default NULL ,
  ESB_TIME varchar(17) default NULL ,
  ESB_RESULT VARCHAR(255) default NULL
);

